e=A.jY('Ob graue Tonne, gelber Sack oder Wertstofftonne, Glascontainer oder Komposthaufen - Abfalltrennen geh\xf6rt l\xe4ngst zum Haushaltsalltag.   \nDoch die bunte Tonnenvielfalt macht das Trennen nicht unbedingt leichter und beim Sortieren kommen immer wieder Fragen auf: D\xfcrfen Joghurtbecher nur sauber gesp\xfclt in die Wertstoffsammlung wandern?    \nK\xf6nnen Flaschen samt Deckel im Altglascontainer landen? Sollen auch Verpackungen ohne gr\xfcnen Punkt in den gelben Sack?   \nKann ich die Bioplastikt\xfcte kompostieren? Wir geben Antworten.  \n\n# Gelber Sack / Gelbe Tonne\n\n(Haben Sie eine Wertstofftonne, lesen Sie bitte den n\xe4chsten Block)  \nHier hinein geh\xf6ren Verpackungen aus Kunststoff, Wei\xdfblech und Aluminium - beispielsweise Folien, Tuben, Konservendosen oder Plastikt\xfcten - sowie die so genannten Verbundverpackungen (etwa Getr\xe4nkekartons).  \nSeit 2009 ist es nicht mehr ausschlaggebend, ob der Gr\xfcne Punkt auf den Verpackungen ist oder nicht. Denn alle Hersteller m\xfcssen sich einem dualen System angeschlossen haben, das die gebrauchten Verpackungen dem Recycling zuf\xfchrt.  \nInzwischen konkurrieren diverse duale Systeme, die mit unterschiedlichen Kennzeichen arbeiten.  \n\nAlso: Selbst wenn auf der H\xfclle k\xfcnftig kein Zeichen mehr prangt, sollten Verbraucher ihren Verpackungsm\xfcll immer \xfcber die "gelbe Tonne" oder den "gelben Sack" entsorgen.  \nLeere Verpackungen m\xfcssen nicht gesp\xfclt werden, l\xf6ffelrein reicht aus. Zu den Verpackungen z\xe4hlen auch die so genannten Serviceverpackungen, die direkt im Handel bef\xfcllt werden.\nDarunter fallen Coffee to go-Becher, die Boxen f\xfcr das take-away-Essen, Folien und Einwickelpapier aus der Metzgerei oder vom K\xe4sestand.  \n    \n### Achtung: \n**Sind die Verpackungen stark mit Essenresten verschmutzt, dann bitte \xfcber die Restm\xfclltonne entsorgen.**  \n\n\nVerpackungen aus Papier oder Glas werden \xfcber Papiertonnen/-container oder Glascontainer gesammelt, siehe weiter unten.  \nSeit dem 1.1.2019 gilt das Verpackungsgesetz.  \nEs soll dazu beitragen, dass mehr Verpackungen - insbesondere aus Kunststoff - recycelt werden und Hersteller Verpackungen produzieren, die tats\xe4chlich verwertbar sind.  \nOb so weniger Verpackungsm\xfcll anf\xe4llt und Verbraucher dadurch finanziell entlastet werden, bleibt abzuwarten.  \n    \n# Werkstofftonne statt gelber Sack / gelber Tonne\n    \n...  \n\n**Source:**   \nhttps://www.verbraucherzentrale.de/wissen/umwelt-haushalt/abfall/muell-richtig-trennen-gelber-sack-restmuell-papier-oder-wohin-sonst-10580\n',A.e9(g,1,19,0,0,0,0),e,B.b2,"Hier erfahren Sie, wie Verpackungen richtig getrennt werden und was unbedingt als Sonderm\xfcll entsorgt werden muss.","M\xfcll richtig trennen. So gehts!")
